  \"north-mississippi-national-wildlife-refuges-complex-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on North Mississippi NWRs Complex for the next 15
  years. This plan outlines the Complex vision and purpose and describes how North
  Mississippi NWRs Complex will contribute to the overall mission of the Refuge System.
  The plan provides an introduction to the Complex, an overview of the CCP process,
  information about plan development, and strategies for implementation. Key planning
  issues include: fish and wildlife populations, habitat management, ecological integrity,
  forest management, visitor services, Refuge administration, and cultural resources.\",\n\t\"license_title\":
